export const loggedIn = (data) => {
  return {
    type: "SIGN_IN",
    info: data,
  };
};

export const setUserDetails = (id) => {
  return {
    type: "SET_USER_DETAILS",
    info: id,
  };
};

export const logout = () => {
  return {
    type: "LOGOUT",
    info: "perform on Logout",
  };
};
